text:
PREZENTACJA: 
przejrzyste z bardzo dużą ilością grubego pyłu w toni, ciemnobursztynowe, dość obfita kremowa piana osiada do kołnierzyka, bardzo ładnie oblepia szkło;
AROMAT: 
cytrusowy i słodowy (karmel, toffi) z wyczuwalnym alkoholem;
ODCZUCIE:
ciało wysokie ku średniemu, nisko nasycone, puszyste, alkohol szczypie w język;
SMAK: 
bardzo krótki, ulotny - karmel, toffi, brzoskwinia, odrobina czekolady, koniaku, niska krótka goryczka;
OGÓLNIE:
spoko, bez rewelacji; liczyłem na ciekawszy aromat i głębszy smak.
